-- This method is called by the pipeline during initializationfunction Initialize ()    local graph = Graph('Lua Test Graph')    return graphendfunction InitializeAlternative ()    local graph = Graph('Alternative Lua Test Graph')    return graphend-- This method is called by the pipeline in a stepfunction ExecuteStep (graph)    local node = Entity('Lua Test Node', graph)    graph.Entities:Add(node)endfunction ExecuteStepAlternative (graph)    local node = Entity('Alternative Lua Test Node', graph)    graph.Entities:Add(node)end